import Footer from "./components/04 Organisms/footer/footer";
import AppRoutes from "./components/Routes/approutes";
import HeaderNavigation from "./components/04 Organisms/HeaderNavigation/HeaderNavigation";
import {UserContext} from "./components/Hooks/Providers/Context";
import {Placeholder} from "./components/05 Pages/CreativeDeveloperProjects";




function App() {

    const [value, setValue] = useState(false);

  return (
          <div className="App">
              <UserContext.Provider value={{value, setValue}}>
                  <GlobalFonts/>
                  <AppRoutes />
                  <HeaderNavigation/>

              </UserContext.Provider>

              <iframe src="https://codesandbox.io/embed/button-component-02ecz?fontsize=14&hidenavigation=1&theme=dark"
