                      sandbox="allow-forms allow-modals allow-popups allow-presentation allow-same-origin allow-scripts"
              ></iframe>
              <MessengerCustomerChat
                  pageId="111788123985865"
                  appId="949279658890551"
                  htmlRef="<REF_STRING>"
              />,
          </div>
  );
}


export default App;

